static int compute(String str){
  int hashCode=0;
  int n=str.length();
  int nBatch=n - 4;
  int i=0;
  while (i < nBatch) {
    hashCode=(str.charAt(i + 3) + 31 * (str.charAt(i + 2) + 31 * (str.charAt(i + 1) + 31 * (str.charAt(i) + 31 * hashCode)))) | 0;
    i+=4;
  }
  while (i < n) {
    hashCode=hashCode * 31 + str.charAt(i++);
  }
  return hashCode | 0;
}

