 */
private static boolean isAccessibleToClassesInSamePackage(JClassType type){
  if (type.isPrivate() || type.isLocalType()) {
    return false;
  }
  if (type.isMemberType()) {
    return isAccessibleToClassesInSamePackage(type.getEnclosingType());
  }
  return true;
}

